import React from "react";
import { BrowserRouter as Router, Routes, Route, Navigate } from "react-router-dom";
import Navbar from "./components/Navbar";
import Login from "./pages/Login";
import Signup from "./pages/Signup";
import Dashboard from "./pages/Dashboard";
import PostProject from "./pages/PostProject";
import BrowseProjects from "./pages/BrowseProjects";
import ManageUsers from "./pages/ManageUsers";

function App() {
  const token = localStorage.getItem("token");

  return (
    <Router>
      {token && <Navbar />}
      <Routes>
        <Route path="/login" element={<Login />} />
        <Route path="/signup" element={<Signup />} />

        {/* Protected routes */}
        <Route path="/dashboard" element={token ? <Dashboard /> : <Navigate to="/login" />} />
        <Route path="/post-project" element={token ? <PostProject /> : <Navigate to="/login" />} />
        <Route path="/browse-projects" element={token ? <BrowseProjects /> : <Navigate to="/login" />} />
        <Route path="/manage-users" element={token ? <ManageUsers /> : <Navigate to="/login" />} />
      </Routes>
    </Router>
  );
}

export default App;
